            if (!empty($attribute['warnings'])) {
                $stat_counts['warninglists'] += count($attribute['warnings']);
            }
            if (!empty($attribute['Sighting'])) {
                $stat_counts['sightings'] += count($attribute['Sighting']);
            }
        }

        foreach ($event['Event']['Object'] as $object) {
